import React from 'react';
import Ccomponent from './Ccomponent';
import { Menu } from './Menu';
import './App.css';


const App = () => {
  return (
  <div>
  <div><Header /></div>
   <div className = "App">
      <ul>
        <li>
          1
        </li>
      </ul>
        <Ccomponent />
        <Menu/>
   </div>
   </div>
  );
}

const Header = () => {
  return (
   <div>
     <a href = "#">Home</a>
     <a>New Feed</a>
     <a>Messages</a>
   </div>
  );
}

export default App;
